import RayaAxiosClient from './raya-axios-client';

/**
 * 
 * @param {*} username
 * @param {*} password
 * @param {*} twoFactorAuthToken
 * @returns {{token: String, username: String }} Object
}
 */
const getAuthToken = async (username, password, twoFactorAuthToken) => {
  console.log('[authService] getAuthToken:');
  const result = await RayaAxiosClient.post('/api/admin/token',
    {
      username,
      password,
      twofactor: twoFactorAuthToken,
    });
  console.log(result);
  return result;
};

export default {
  getAuthToken,
};
